/* ---------------------------------------------- /*
 * Preloader
/* ---------------------------------------------- */

$('.lazy').lazy();

$('#pre-status').fadeOut();
$('#tt-preloader').delay(50).fadeOut('slow');

// -------------------------------------------------------------
// Full Screen Slider
// -------------------------------------------------------------
$('.tt-fullHeight').height($(window).height());

$(window).resize(function() {
  $('.tt-fullHeight').height($(window).height());
});

// -------------------------------------------------------------
// Menu
// -------------------------------------------------------------
const $menu = $('.navbar-custom');
$(document).click(function(event) {
  const $navbar = $('.navbar-collapse');
  const $opened = $navbar.hasClass('in');
  if ($opened === true
    && $menu.has(event.target).length === 0) {
    $navbar.collapse('hide');
  }
});

// -------------------------------------------------------------
// Animated scrolling
// -------------------------------------------------------------

$('body').scrollspy({ target: '.navbar' });

$('a[href*="#"]').bind('click', function(e) {
  const anchor = $(this);
  $('html, body').stop().animate({
    scrollTop: $(anchor.attr('href')).offset().top,
  }, 1000);
  // e.preventDefault();
});
const Wow = window.WOW;
const wowInstance = new Wow({
  mobile: false,
}).init();

// -------------------------------------------------------------
// Countup
// -------------------------------------------------------------
$('.count-wrap').bind('inview',
  function(event, visible, visiblePartX, visiblePartY) {
    if (visible) {
      $(this).find('.timer').each(function() {
        const $this = $(this);
        $({ Counter: 0 }).animate({ Counter: $this.text() }, {
          duration: 2000,
          easing: 'swing',
          step: function() {
            $this.text(Math.ceil(this.Counter));
          },
        });
      });
      $(this).unbind('inview');
    }
  });

// -------------------------------------------------------------
// Progress Bar
// -------------------------------------------------------------


$('.skill-progress').bind('inview',
  function(event, visible, visiblePartX, visiblePartY) {
    if (visible) {
      $.each($('div.progress-bar'), function() {
        $(this).css('width', $(this).attr('aria-valuenow') + '%');
      });
      $(this).unbind('inview');
    }
  });


// -------------------------------------------------------------
// More skill
// -------------------------------------------------------------
$('.main-skills').bind('inview',
  function(event, visible, visiblePartX, visiblePartY) {
    if (visible) {
      $('.chart').easyPieChart({
        easing: 'easeOut',
        delay: 3000,
        barColor: '#ff8080',
        trackColor: '#e1e1e1',
        scaleColor: false,
        lineWidth: 8,
        size: 140,
        animate: 2000,
        onStep: function(from, to, percent) {
          this.el.children[0].innerHTML = Math.round(percent);
        },

      });
      $(this).unbind('inview');
    }
  });

// -------------------------------------------------------------
// Shuffle
// -------------------------------------------------------------
const Shuffle = window.Shuffle;
Shuffle.options.isCentered = true;
// Shuffle.options.useTransforms = true;
const element = document.querySelector('.my-shuffle-container');
const sizer = element.querySelector('.my-sizer-element');
const shuffleInstance = new Shuffle(element, {
  itemSelector: '.picture-item',
  sizer: sizer, // could also be a selector: '.my-sizer-element'
});

/* reshuffle when user clicks a filter item */
$('.shuffle-button').bind('click', function(e) {
  const anchor = $(this);
  const query = anchor.attr('data-group');
  if (query === 'all') shuffleInstance.filter();
  shuffleInstance.filter(query);
});

// -------------------------------------------------------------
// Back To Top
// -------------------------------------------------------------

$(window).scroll(function() {
  if ($(this).scrollTop() > 100) {
    $('.scroll-up').fadeIn();
  } else {
    $('.scroll-up').fadeOut();
  }
});


let isMobile = false; // initiate as false
const regex = new RegExp(
  /Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i);

// device detection
if (regex.test(navigator.userAgent)) {
  isMobile = true;
}

$('.location-map').bind('inview',
  function(event, visible, visiblePartX, visiblePartY) {
    if (visible && !isMobile) {
      loadAPI();
      $(this).unbind('inview');
    } else {
      $(this).css('display', 'none');
    }
  });
function loadAPI() {
  $.ajax({
    url: 'https://maps.googleapis.com/maps/api/js?key=AIzaSyA3bPGZhH-iD28-Bpht14BiGhun_Pc3iSU',
    type: 'GET',
    // crossDomain: true,
    dataType: 'jsonp',

    success: function(result, status, xhr) {
      const Google = window.google;
      const myLatLng = { lat: 42.669, lng: 23.280 };

      const map = new Google.maps.Map(
        document.body.querySelector('.location-map'), {
          center: myLatLng,
          zoom: 11,
        });
      const marker = new Google.maps.Marker({
        position: myLatLng,
        map: map,
        title: 'Hello World!',
      });
    },
    error(xhr, status, error) {
      // ...
    },
  });
}

